def unhex(s):
    bits = 0
    for c in s:
        c = bytes((c,))
        if ('0' <= c <= '9'):
            i = ord('0')
        elif ('a' <= c <= 'f'):
            i = (ord('a') - 10)
        elif ('A' <= c <= 'F'):
            i = (ord('A') - 10)
        else:
            assert False, ('non-hex  digit  ' + repr(c))
        bits = ((bits * 16) + (ord(c) - i))
    return bits

