def _default_selem(func):
    @functools.wraps(func)
    def func_out(image, selem=None, *args, **kwargs):
        if (selem is None):
            selem = ndi.generate_binary_structure(image.ndim, image.ndim)
        return func(image, selem=selem, *args, **kwargs)
    return func_out

